import React from 'react';
import axios from 'axios';
import SearchBar from './SearchBar';

const KEY = 'AIzaSyDRsPztCjKmboO5QqAOSzLLn5fJDJCxUD0'

export default axios.create({
    baseURL: 'https://www.googleapis.com/youtube/v3',
    params: {
      part: 'snippet', 
      type: 'video',
      maxResults: 5,
      key: KEY
  }
});
